import React from 'react';
// import Card from './Card';
const numbers = [1, 4, 6, 8, 45, 89];
const App = () => {
  const numberList = () => {
    numbers.map(<li>{(number) => number + 1}</li>);
  };
  return (
    <>
      <ul>{numberList}</ul>
    </>
  );
};

export default App;
